ute('download', 'exoplots_download.txt');\n    link.setAttribute('target', '_blank');\n    link.href = makeTextFile(makeCSV(sources, keys, header));\n    document.body.appendChild(link);\n\n    // wait for the link to be added to the document\n    window.requestAnimationFrame(function() {\n      var event = new MouseEvent('click');\n      link.dispatchEvent(event);\n      document.body.removeChild(link);\n    });\n    "}}]]]},"styles":{"type":"map","entries":[["margin","auto 5px"]]},"label":"Download CSV of Selected Data"}},{"type":"object","name":"Div","id":"p1576","attributes":{"styles":{"type":"map","entries":[["margin","auto -3px auto 5px"]]},"text":"Kepler:"}},{"type":"object","name":"ColorPicker","id":"p1577","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:color",[{"type":"object","name":"CustomJS","id":"p1578","attributes":{"args":{"type":"map","entries":[["other",{"type":"object","name":"Scatter","id":"p1466","attributes":{"x":{"type":"field","field":"insolation"},"y":{"type":"field","field":"met"},"size":{"type":"value","value":6},"line_color":{"type":"value","value":"#228833"},"line_alpha":{"type":"value","value":0.4},"fill_color":{"type":"value","value":"#228833"},"fill_alpha":{"type":"value","value":0.4},"hatch_color":{"type":"value","value":"#228833"},"hatch_alpha":{"type":"value","value":0.4},"marker":{"type":"value","value":"circle_cross"}}}]]},"code":"other.fill_color = this.color"}},{"type":"object","name":"CustomJS","id":"p1579","attributes":{"args":{"type":"map","entries":[["other",{"id":"p1466"}]]},"code":"other.hatch_color = this.color"}},{"type":"object","name":"CustomJS","id":"p1580","attributes":{"args":{"type":"map","entries":[["other",{"id":"p1466"}]]},"code":"other.line_color = this.color"}},{"type":"object","name":"CustomJS","id":"p1581","attributes":{"args":{"type":"map","entries":[["other",{"type":"object","name":"Scatter","id":"p1468","attributes":{"x":{"type":"field","field":"insolation"},"y":{"type":"field","f
